import React from 'react';
import './App.css';

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      username: '',
      password: '',
    }
  }

  render() {
    return(
      <input aria-label="Username" value={this.state.username}>Username</input>
    );
  }
}

export default App;
